}

resource "aws_iam_policy" "ecs_task_execution_secrets_policy" {
  name        = "${local.name_prefix}-ecs-execution-secrets"
  description = "Allow ECS task execution role to read database credentials from Secrets Manager"

  policy = jsonencode({
    Version = "2012-10-17"
    Statement = [
      {
        Effect = "Allow"
