}

resource "aws_iam_policy" "ecs_task_cloudwatch_policy" {
  name        = "${local.name_prefix}-ecs-task-cloudwatch"
  description = "Allow ECS tasks to write CloudWatch logs"

  policy = jsonencode({
    Version = "2012-10-17"
    Statement = [
      {
        Effect = "Allow"
